    {
      "cell_type": "markdown",
      "id": "e1d9607a",
      "metadata": {
        "id": "e1d9607a"
      },
      "source": [
        "## 3. Data Cleaning and Preprocessing\n",
        "\n",
        "We perform the following steps:\n",
        "\n",
        "1. **Remove rows without a valid `CustomerID`** (cannot aggregate at customer-level otherwise).  \n",
        "2. **Drop rows with missing `Description`** (for simplicity; other strategies like imputation are possible).  \n",
        "3. **Convert data types** (`InvoiceDate` to datetime, `CustomerID` to integer).  \n",
        "4. **Remove cancellations** (invoices where `InvoiceNo` starts with `'C'`).  \n",
        "5. **Remove negative or zero quantities and prices**.  \n",
        "6. **Create `TotalPrice` = `Quantity * UnitPrice`**.\n",
        "7. **Create `InvoiceDateOnly`: date-only for daily analysis**.\n",
        "8. **Create `InvoiceMonthOnly`: month-only for monthly analysis**."
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 7,
      "id": "9bc48201",
      "metadata": {
        "id": "9bc48201"
      },
      "outputs": [],
      "source": [
        "df_clean = df.copy()\n",
        "df_clean = df_clean.dropna(subset=[\"CustomerID\"])"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 8,
      "id": "f995d472",
      "metadata": {
        "id": "f995d472"
      },
      "outputs": [],
      "source": [
        "df_clean = df_clean.dropna(subset=[\"Description\"])"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 9,
      "id": "e71af809",
      "metadata": {
        "id": "e71af809"
      },
      "outputs": [],
      "source": [
        "df_clean[\"InvoiceDate\"] = pd.to_datetime(df_clean[\"InvoiceDate\"])\n",
        "df_clean[\"CustomerID\"] = pd.to_numeric(df_clean[\"CustomerID\"], errors=\"coerce\")\n",
        "df_clean = df_clean.dropna(subset=[\"CustomerID\"])\n",
        "df_clean[\"CustomerID\"] = df_clean[\"CustomerID\"].astype(int)\n"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 10,
      "id": "443ff2d9",
      "metadata": {
        "id": "443ff2d9"
      },
      "outputs": [],
      "source": [
        "df_clean = df_clean[~df_clean[\"InvoiceNo\"].astype(str).str.startswith(\"C\")]"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 11,
      "id": "1ccedba9",
      "metadata": {
        "id": "1ccedba9"
      },
      "outputs": [],
      "source": [
        "df_clean = df_clean[(df_clean[\"Quantity\"] > 0) & (df_clean[\"UnitPrice\"] > 0)]\n"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 12,
      "id": "dde440cf",
      "metadata": {
        "id": "dde440cf"
      },
      "outputs": [],
      "source": [
        "df_clean[\"TotalPrice\"] = df_clean[\"Quantity\"] * df_clean[\"UnitPrice\"]"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 13,
      "id": "5b5ee47a",
      "metadata": {
        "id": "5b5ee47a"
      },
      "outputs": [],
      "source": [
        "df_clean[\"InvoiceDateOnly\"] = df_clean[\"InvoiceDate\"].dt.date"
      ]
    },
    {
      "cell_type": "code",
      "execution_count": 14,
      "id": "d84e9baa",
      "metadata": {
        "id": "d84e9baa"
      },
      "outputs": [],
      "source": [
        "df_clean[\"InvoiceMonth\"] = df_clean[\"InvoiceDate\"].dt.to_period(\"M\")"
      ]
    },
