        "Customer Segmentation Analysis\n",
        "Based on the K-Means clustering results (K=4), we identified four distinct customer segments with clear behavioral patterns:\n",
        "\n",
        "1. **The \"Whales\"** (Cluster 0 - Purple)\n",
        "\n",
        "Profile: Extremely high spending (Â£86k avg) and frequency (100+ invoices). Very low recency (purchased ~2 days ago).\n",
        "\n",
        "Insight: These 10 customers are likely large wholesalers. They are the most critical revenue drivers despite their small number.\n",
        "\n",
        "Action: Assign dedicated account managers; offer B2B bulk discounts.\n",
        "\n",
        "2. **Loyal VIPs** (Cluster 3 - Yellow)\n",
        "\n",
        "Profile: High spending (Â£6k avg) and regular purchase frequency (~10 times/year). Active within the last month.\n",
        "\n",
        "Insight: These ~950 customers represent the core loyal customer base. They consistently generate significant value.\n",
        "\n",
        "Action: Implement a loyalty program; target with cross-selling/up-selling campaigns.\n",
        "\n",
        "3. **Active Regulars** (Cluster 1 - Blue)\n",
        "\n",
        "Profile: Moderate spending (Â£761 avg) and low frequency (~2-3 times). Active within the last 2 months.\n",
        "\n",
        "Insight: This is the largest segment (2,353 customers). They are active but spend less per transaction.\n",
        "\n",
        "Action: Use marketing prompts (e.g., coupons, recommendations) to increase purchase frequency and basket size.\n",
        "\n",
        "4. **At-Risk / Hibernating** (Cluster 2 - Green)\n",
        "\n",
        "Profile: High recency (>8 months since last purchase) and very low frequency (1-2 times).\n",
        "\n",
        "Insight: These ~1,000 customers have likely churned or were one-time buyers.\n",
        "\n",
        "Action: Launch win-back email campaigns. If unresponsive, reduce marketing spend on this group to focus on active segments."
